CREATE TABLE `trip` (
  `trip_id` int(11) NOT NULL AUTO_INCREMENT,
  `trip_name` varchar(255) DEFAULT NULL COMMENT 'trip_id in GTFS',
  `fleet_id` int(11) DEFAULT NULL,
  `calendar_id` int(11) DEFAULT NULL COMMENT 'Calendar followed by this trip',
  `direction` tinyint(1) DEFAULT NULL,
  `route_id` int(11) DEFAULT NULL,
  `frequency_trip` tinyint(1) DEFAULT '0' COMMENT 'True if this entry represents multiple trips spread at a given frequency',
  `frequency_start_time` time DEFAULT NULL COMMENT 'Time at which the trips operate on a frequency',
  `frequency_end_time` time DEFAULT NULL,
  `frequency_gap` time DEFAULT NULL COMMENT 'Time difference between 2 trips of this frequency trip',
  `last_upd_by` int(11) DEFAULT NULL,
  `last_upd_on` datetime DEFAULT NULL,
  PRIMARY KEY (`trip_id`),
  KEY `fleet_id` (`fleet_id`),
  KEY `last_upd_by` (`last_upd_by`),
  KEY `idx_trip_route` (`route_id`),
  CONSTRAINT `trip_ibfk_1` FOREIGN KEY (`route_id`) REFERENCES `route` (`route_id`),
  CONSTRAINT `trip_ibfk_2` FOREIGN KEY (`fleet_id`) REFERENCES `fleet` (`fleet_id`),
  CONSTRAINT `trip_ibfk_3` FOREIGN KEY (`last_upd_by`) REFERENCES `user` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1489 DEFAULT CHARSET=latin1 COMMENT='Used for trips.txt and frequencies.txt';
